import React,{useEffect} from 'react'
import alanBtn from "@alan-ai/alan-sdk-web";
export default function useAlan() {


    useEffect(() => {
        alanBtn({ 
            key: 'c0558ab0ae1d903f14cf002e918a2eae2e956eca572e1d8b807a3e2338fdd0dc/stage',
            onCommand: ({command}) => {
                if(command==='BUY')
                {console.log(command);
                    this.playText('Buying!!');
                }
                    
            },
          });
    }, [])
    return (
        null
    )
}
